// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";


contract TestNFT is ERC721, Pausable, Ownable {
    using SafeMath for uint256;

    uint256 public constant MAX_SUPPLY = 42;
    string private constant BASE_URI = "https://gateway.pinata.cloud/ipfs/QmcNJwDXsuPWMQET7XbQNXoCsFHPDgcBZpL5MnrdQKhUA1";

    uint256 public totalSupply;
    mapping(address => bool) public nftOwners;


    constructor() ERC721("NAME", "SYMBOL") {}

    function tokenURI(uint256 tokenId) public view override returns (string memory) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");
        return _baseURI();
    }

    function _baseURI() internal view override returns (string memory) {
        return BASE_URI;
    }

    function mint() public whenNotPaused {
        require(!nftOwners[msg.sender], "CornFi NFT: User can only mint once");
        _safeMint(msg.sender, totalSupply++);
        nftOwners[msg.sender] = true;
        require(totalSupply <= MAX_SUPPLY, "CornFi NFT: Max supply reached");
    }

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }
}
